import React, { useState } from 'react';
import './App.css';


const App = () => {
  const baseUrl = 'https://jsonplaceholder.typicode.com/todos/1'

  const [data] = useState({ test: "this is a test" });



  return (
    <div className="App">
      <button>
        Click Me
      </button>
      {data.test}
    </div>
  );
};

export default App;
